-- ----------------------------
-- Table structure for water_data
-- ----------------------------
DROP TABLE IF EXISTS `water_data`;
CREATE TABLE `water_data` (
  `id` int(20) NOT NULL COMMENT '数据⁯id',
  `aid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '8848' COMMENT '区域编号',
  `tem` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '28.5' COMMENT '水温',
  `ph` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '7.14' COMMENT '水质酸碱度',
  `N_data` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '3' COMMENT '总氮含量',
  `P_data` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '总磷含量',
  `Q_data` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '氰化物含量',
  `S_data` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '硫化物含量',
  `Fu_data` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '氟化物含量',
  `Bac_data` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '2200' COMMENT '细菌数量',
  `sampling_by` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '唐耿涛' COMMENT '采集人员',
  `sampling_time` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '采集时间',
  `remark` int(1) NOT NULL DEFAULT '1' COMMENT '是否有效',
