-- ----------------------------
-- View structure for envsecwarn
-- ----------------------------
DROP VIEW IF EXISTS `envsecwarn`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `envsecwarn` AS select `secwarning`.`mid` AS `mid`,`secwarning`.`content` AS `content`,`secwarning`.`alarm_value` AS `alarm_value` from `secwarning` where (`secwarning`.`belong` = '环境数据') ;

-- ----------------------------
-- View structure for env_hum
-- ----------------------------
DROP VIEW IF EXISTS `env_hum`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `env_hum` AS select `secwarning`.`mid` AS `mid`,`env_data`.`hum` AS `hum`,`env_data`.`time` AS `time`,`secwarning`.`content` AS `content` from (`secwarning` join `env_data`) where ((`secwarning`.`mid` = 5) and ((`env_data`.`hum` < 25) or (`env_data`.`hum` > 80))) ;

