-- ----------------------------
-- View structure for view_envsec_areatime
-- ----------------------------
DROP VIEW IF EXISTS `view_envsec_areatime`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_envsec_areatime` AS select `a`.`aid` AS `aid`,`a`.`parentaid` AS `parentaid`,`a`.`aname` AS `aname`,`a`.`note` AS `note`,`b`.`time` AS `time` from (`area` `a` join `env_data` `b`) where (`a`.`aid` = `b`.`aid`) order by `b`.`time` desc ;

-- ----------------------------
