CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_data` AS select `a`.`id` AS `id`,`a`.`type` AS `type`,`a`.`rid` AS `rid`,`a`.`rname` AS `rname`,`a`.`data` AS `riverdata`,`b`.`data` AS `tempdata`,`c`.`data` AS `raindata`,`a`.`time` AS `time` from ((`river_data` `a` join `temp_data` `b`) join `rain_data` `c` on(((`a`.`id` = `b`.`id`) and (`b`.`id` = `c`.`id`) and (`a`.`id` = `c`.`id`) and (`a`.`rname` = `b`.`rname`) and (`b`.`rname` = `c`.`rname`) and (`a`.`rname` = `c`.`rname`)))) ;

