CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_energy` AS select `a`.`id` AS `id`,`a`.`tid` AS `tid`,`a`.`addrid` AS `addrid`,`b`.`aname` AS `aname`,`a`.`colltime` AS `colltime`,`a`.`fvoltage` AS `fvoltage`,`a`.`gvoltage` AS `gvoltage`,`a`.`rechcurrent` AS `rechcurrent`,`a`.`loadcurrent` AS `loadcurrent`,`a`.`outvoltage` AS `outvoltage`,`a`.`extvoltage` AS `extvoltage`,`a`.`sunvoltage` AS `sunvoltage`,`a`.`worktemp` AS `worktemp`,`a`.`rechstatus` AS `rechstatus`,`a`.`workstatus` AS `workstatus`,`a`.`remark` AS `remark` from (`tb_energy` `a` join `area` `b` on((`a`.`addrid` = `b`.`aid`))) ;

